import React from 'react';
import '../styles/SuccessPage.css'; // Correct path to CSS file
import logo from '../assets/logo.png'; // Path to logo image

const SuccessPage = () => {
  return (
    <div className="success-container">
      <div className="logo-container">
        <img src={logo} alt="Robert Motoring Consult" className="logo" />
      </div>
      <h1>Booking Successful!</h1>
      <p>
        This is only a booking, the payment of the services will be negotiated
        directly on-site, and charges will be agreed upon before it is undertaken.
      </p>
      <button onClick={() => window.location.href = '/'}>Go Back to Home</button>
    </div>
  );
};

export default SuccessPage;
